    public static void main\(String[] args\) throws Exception {
        // Read file bytes
        byte[] bytes = Files.readAllBytes\(Paths.get\("src/test/resources/logical_types_test.parquet"\)\);
        System.out.println\("File size: " + bytes.length + " bytes"\);

        // Parse footer
        if \(bytes.length < 8\) {
            System.out.println\("File too small"\);
            return;
        }

        // Last 4 bytes are "PAR1"
        // 4 bytes before that are footer length
        int footerLen = \(\(bytes[bytes.length - 8] & 0xFF\)\) |
                       \(\(bytes[bytes.length - 7] & 0xFF\) << 8\) |
                       \(\(bytes[bytes.length - 6] & 0xFF\) << 16\) |
                       \(\(bytes[bytes.length - 5] & 0xFF\) << 24\);
        System.out.println\("Footer length: " + footerLen\);

